function [baseCentres, aodDirectionVectors, zFocusPredicted, aolDrives] = calculate_aol_drive6(driveParams)
% Returns (cell()) aodDirectionVectors; (cell[numOfAods](3,numOfDrives)) aodCentres; (numOfAods,numOfDrives) chirp; numOfAods,numOfDrives baseFreq}

optimalBaseFreq = driveParams.optimalBaseFreq;
xyDeflectionMm = driveParams.xyDeflectionMm;
xyScanSpeed = driveParams.xyScanSpeed;
focalLengths = driveParams.focalLength;
lambda = driveParams.opWavelenVac;

widthOfAod = 8e-3;
correctionDistance = widthOfAod * ( 1 - 1/2.26 );
V = 612.9;

aodDirectionVectors = 0.5 * [2,1,-1,-2,-1,1;0,sqrt(3),sqrt(3),0,-sqrt(3),-sqrt(3)];
aodSpacing = 5e-2;

chirp = get_chirps(focalLengths, xyScanSpeed(1,:), lambda, V);
baseFreq = get_base_ray_freqs(focalLengths, xyDeflectionMm(1,:)*1e-3, xyDeflectionMm(2,:)*1e-3, lambda, V, aodSpacing, optimalBaseFreq);
baseCentres = get_base_ray_xy(baseFreq, lambda, V, aodSpacing, focalLengths, aodDirectionVectors); % [xy, aodnum, drive]
zFocusPredicted = 5 * aodSpacing + focalLengths;

aolDrives = aol_drive_freqs(baseFreq',chirp);

    function xy = get_base_ray_xy(freqs, lambda, V, spacing, focal_lengths, ac_dirs)

        xy = zeros(2,7,numel(focal_lengths));
        for m = 1:7
            m_is_7 = max(0, m-6);
            xy(1,m,:) = ...
                (max(0, m-1) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(1,:) .* ac_dirs(1,1) + ...
                (max(0, m-2) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(2,:) .* ac_dirs(1,2) + ...
                (max(0, m-3) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(3,:) .* ac_dirs(1,3) + ...
                (max(0, m-4) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(4,:) .* ac_dirs(1,4) + ...
                (max(0, m-5) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(5,:) .* ac_dirs(1,5) + ...
                (max(0, m-6) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(6,:) .* ac_dirs(1,6);

            xy(2,m,:) = ...
                (max(0, m-1) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(1,:) .* ac_dirs(2,1) + ...
                (max(0, m-2) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(2,:) .* ac_dirs(2,2) + ...
                (max(0, m-3) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(3,:) .* ac_dirs(2,3) + ...
                (max(0, m-4) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(4,:) .* ac_dirs(2,4) + ...
                (max(0, m-5) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(5,:) .* ac_dirs(2,5) + ...
                (max(0, m-6) * spacing + m_is_7 * (focal_lengths-spacing)) .* freqs(6,:) .* ac_dirs(2,6);
        end

        factor = lambda/V;
        xy = xy * factor;
    end

    function freqs = get_base_ray_freqs(focal_lengths, x_pos, y_pos, lambda, V, spacing, opt_freqs)
        factor = V / lambda;
        shift5 = factor * (y_pos/sqrt(3) + x_pos) ./ (spacing + focal_lengths);
        shift6 = factor * (y_pos/sqrt(3) - x_pos) ./ focal_lengths;
        freqs = opt_freqs' * ones(size(shift5)) + [zeros(size(shift5)); zeros(size(shift5)); zeros(size(shift5)); zeros(size(shift5)); shift5; shift6];
    end

